import * as React from 'react';
import { Text, View,Button,Image,List, TouchableOpacity } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Ionicons from 'react-native-vector-icons/Ionicons';
import { SafeAreaView, FlatList, StyleSheet,  StatusBar } from 'react-native';
import Users from './pages/foodpage';
import { Colors } from 'react-native/Libraries/NewAppScreen';



function HomeScreen({ navigation }) {
  return (
    <View style={{ flexDirection: 'row', height: 50}}>
      <TouchableOpacity
      style={{
        width:50,
        paddingLeft: SIZE.padding*2,
        justifyContent: 'center'
      }}>
        <Image
        source={icon.nearby}
        resizeMode="contain"
        style={{
          width: 30,
          height:30
        }}/>
              </TouchableOpacity>
    <View style={{ flex: 1,alignItems: 'center',justifyContent:'center'}}>
      <View
       style= {{
         width: '70%',
         height: "100%",
         backgroundColor: Colors.lightGray3,
         alignItems: 'center',
         justifyContent: 'center',
         borderRadius: SIZE.radius
       }}>

         <Text style={{ ...FONTS.h3}}>Location</Text>
        </View>

      </View>
    <TouchableOpacity
      style={{
        width: 50,
        paddingRight: SIZE.padding*2,
        justifyContent:'center'
      }}

    >
      <Image
      source={Ionicons='airplane-outline'}
      resizeMode='contain'
      style={{
        width:30,
        height:30
      }}
      />
      </TouchableOpacity>
    </View>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: StatusBar.currentHeight || 0,
  },
  item: {
    backgroundColor: '#f9c2ff',
    padding: 20,
    marginVertical: 8,
    marginHorizontal: 16,
  },
  title: {
    fontSize: 32,
  },
});


function SettingsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Users/>
    </View>
  );
}


function SearchScreen({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Find Ur Food!</Text>

    </View>
  );
}

function ProfileScreen({ navigation }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>See ur profile!</Text>
    </View>
  );
}


const Tab = createBottomTabNavigator();

export default function App() {


  return (
    <NavigationContainer>
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          let iconName;

          if (route.name === 'Home') {
            iconName = focused
              ? 'ios-information-circle'
              : 'ios-information-circle-outline';
          } else if (route.name === 'Settings') {
            iconName = focused ? 'ios-list-box' : 'ios-list';
          }
          else if (route.name === 'Profile') {
            iconName = focused ? 'happy-outline' : 'person-circle-outline';
          }
          else if (route.name === 'Search') {
            iconName = focused ? 'bulb' : 'bulb-outline';
          }

          // You can return any component that you like here!
          return <Ionicons name={iconName} size={size} color={color} />;
        },
      })}
      tabBarOptions={{
        activeTintColor: 'tomato',
        inactiveTintColor: 'gray',
      }}
    >
      <Tab.Screen name="Home" component={HomeScreen} />
      <Tab.Screen name="Search" component={SearchScreen} />
      <Tab.Screen name="Profile" component={ProfileScreen} />
      <Tab.Screen name="Settings" component={SettingsScreen} />
    </Tab.Navigator>
  </NavigationContainer>

  );
}
const styless = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    marginHorizontal: 16,
  },
  tinyLogo: {
    width: 50,
    height: 50,
  },
  title: {
    textAlign: 'center',
    marginVertical: 8,
  },
  fixToText: {
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  separator: {
    marginVertical: 8,
    borderBottomColor: '#737373',
    borderBottomWidth: StyleSheet.hairlineWidth,
  },
});
